package com.hzr.demo.entity;import jakarta.persistence.*;import org.hibernate.annotations.GenericGenerator;/** * @Classname file * @Author: hzr * @Description TODO * @Version 1.0.0 * @Date 2023/12/6 15:14 * @Created by 22906 */@Entitypublic class FileEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private String fileName;    private String filePath;    private String fileType;    private String fileSize;    private String fileTime;    public FileEntity() {}    public FileEntity(Long id, String fileName, String filePath, String fileType, String fileSize, String fileTime) {        this.id = id;        this.fileName = fileName;        this.filePath = filePath;        this.fileType = fileType;        this.fileSize = fileSize;        this.fileTime = fileTime;    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getFileName() {        return fileName;    }    public void setFileName(String fileName) {        this.fileName = fileName;    }    public String getFilePath() {        return filePath;    }    public void setFilePath(String filePath) {        this.filePath = filePath;    }    public String getFileType() {        return fileType;    }    public void setFileType(String fileType) {        this.fileType = fileType;    }    public String getFileSize() {        return fileSize;    }    public void setFileSize(String fileSize) {        this.fileSize = fileSize;    }    public String getFileTime() {        return fileTime;    }    public void setFileTime(String fileTime) {        this.fileTime = fileTime;    }    @Override    public String toString() {        return "file{" +                "id='" + id + '\'' +                ", fileName='" + fileName + '\'' +                ", filePath='" + filePath + '\'' +                ", fileType='" + fileType + '\'' +                ", fileSize='" + fileSize + '\'' +                ", fileTime='" + fileTime + '\'' +                '}';    }}